Sooo we‚Äôve been really excited about this one, and it had taken us most of the year to do it! Between a few different iterations across multiple methodologies, then having to move recently halting everything, to the print itself breaking during the move itself, we‚Äôre just stoked to have finally wrapped this fun build up. 

If you‚Äôve already been following us, you‚Äôll know that we‚Äôve been trying out different designs for a chassis to mount to our EXT external radiator stand, or onto the radiator itself. The vision here is a literal representation of how we approach the PC industry as a whole - to change the status quo on how a PC build can be approached and accomplished. 

The VESA standards as a whole have helped the tech industry stay cohesive and coherent across so many different companies. Utilizing their idea and applying it literally here provided an awesome way to build and utilize a PC. VESA mounts are everywhere, and with a few brands upping the game at how they produce monitor arms, means aesthetics are also coming to the fold. 

If aesthetically minded monitor arms are becoming a thing, we‚Äôre all here for it. We‚Äôve had Ergotron arms for many years, and it‚Äôs always been surprising how strong they are for just a simple tool to hold a monitor. Asus and their ROG Ergo AAS01 Monitor Arm now provide an awesome mesh between that surprising strength and ROG aesthetics that we knew immediately needed a whole Asus ROG themed build around!

We went full ATX this time - ATX motherboard as well as ATX PSU to achieve a fully functional and ergonomic gaming and work PC that essentially has no footprint on your desk. Though of course we went above and beyond, fusing our EXT XL system for an external 3x180mm radiator setup. The MDPC-X sleeved tubing works perfectly in the cable grooves of the Asus monitor arm to keep things super clean. 

Should we make this VESA chassis available on our website? There‚Äôs a whole extra part to it that we never finished either hahaha. Let us know and enjoy! Shout out to Asus for sponsoring us!

